const cardData = [
  {
    title: "Student Corner",
    accordions: [
      { id: "1", to: "/registration-student", content: "New Registration" },
      { id: "2", to: "/student-login", content: "Login" },
    ],
  },
  {
    title: "Organization Corner",
    accordions: [
      { id: "3", to: "/registration-organization", content: "New Registration" },
      { id: "4", to: "/organization-login", content: "Login" },
    ],
  },
  {
    title: "Institute Corner",
    accordions: [
      {id:"5",to:"/registration-institute",content: "Institute Registration"},
      { id: "6", to: "/institute-login", content: "Institute Login" },
      
    ],
  }
];

export default cardData;
